import styled from "styled-components";

const Container = styled.div ` 
    height: 100vh;

    padding-top: 90px;
    margin-bottom: 85px;
    padding-right: 17px;
    padding-left: 17px;
    background-color: #E5E5E5;
`;

const Title = styled.div`
    padding-top: 28px;
    padding-bottom: 17px;
    font-size: 23px;
    color: #126BA5;
`;

const Text = styled.div `
    font-size: 18px;
    color: #666666;
`;

export {
    Container,
    Title,
    Text
}
